post_text:
We are working with the South Heartland Health District on graduation plans. As of today the plan is as follows;
Graduation date Saturday July 11th @ Bladen Gym 4 p.m.
Family Invitation only and we are asking that the 7 graduating seniors limit it to 25 invited guests to adhere to social distancing guidelines. We will follow guidelines set in place by our local health department and if the guidelines become less restrictive we will adjust accordingly. It will be live-streamed for those who are unable to attend. I appreciate your patience and support with this. Excited to see our graduates take part in a ceremony.

